import React from 'react';
import axios from 'axios';

class Read extends React.Component{

    state = {
        books: []
    };

    componentDidMount() {
        axios.get('http://localhost:4000/api/books')
        .then((response)=>{
            this.setState({books: response.data.books})
        })
        .catch((error)=>{
            console.log(error);
        });
    }

    render(){
        return(
            <div>
                <h2>Books Finished Reading</h2>
            </div>
        )
    }
}
export default Read;
